import React from 'react';

const ResultsPage = ({ summary }) => {
    return (
      <div className="page-content">
        <div>
            <h1>Results</h1>
            <p className=".results-content">{summary}</p>
        </div>
      </div>
    );
};

export default ResultsPage;
